import {Component} from "react";


export default function Navbar({ children }) {
    return (
        <header>
            <h1 className="pageTitle">Fun Website</h1>
            <div className="dropdown">
                <button className="dropbtn" >Menu</button>
                <div className="dropdown-content">
                    <a href="#">Dashboard</a>
                    <a href="#">Profile</a>
                </div>
            </div>
        </header>
    )
}
